import { StatusBar } from "expo-status-bar";
import React from "react";
import {
  StyleSheet,
  Text,
  View,
  Alert,
  FlatList,
  ImageBackground,
  Image,
  Dimensions,
  TouchableHighlight,
  AsyncStorage,
  ScrollView
} from "react-native";

import SessionNavbar from "./security/SessionNavbar";
import Home from "../screens/Main";
const bgImg = require("../../assets/bg/y.jpg");

export default class Main extends React.Component {
    constructor(props) {
        super(props);
      }
    
      state = {
        isLoggedIn: false
      };
    
      async componentDidMount() {
        let session = await AsyncStorage.getItem("session");
    
        if (session) {
          
          console.log(session)
          this.setState({
            
            isLoggedIn: true,
          });
        }
      }
  
  render() {
    const { navigation } = this.props;
    if(this.state.isLoggedIn === false){
        return(
            <ScrollView  style={{backgroundColor:"white"}}>
            <SessionNavbar navigation={navigation}></SessionNavbar>
            <Text style={styles.texto}>Sube publicaciones sobre tus videojuegos favoritos</Text>
            
            <Text style={styles.texto}>Mira diferentes videojuegos</Text>
            <Text style={styles.texto}>Conoce ofertas de tus videojuegos favoritos</Text>
            <Text style={styles.texto}>Comparte con otros usuarios con chat en vivo</Text>
            </ScrollView>
          );
    }else{
        return <Home navigation={navigation}></Home>
    }
   
}
}

const styles = StyleSheet.create({
  imagenHome: {
    height:500,
    width: "100%",
    marginTop:30,
    paddingEnd:30
  },
  backgroundApp: {
    flex: 1,
     width: Dimensions.get("window").width 
    
  },

  texto:{
    alignItems: "center",
    justifyContent: "center",
    color: "black", 
    fontWeight: 'bold',
     fontSize: 27
  },
  homeView: {
    alignItems: "center",
    alignContent: "center",
    flex: 1
  },
});
